Тендер савдоларида қатнашиш истагини билдирган қурилиш ташкилотлари тендер буюртмасини таъминлаш кафолати объект бошланғич нархининг 0,5% миқдорида тўлов топшириқномасини ёки тижорат банк томонидан берилган тендер буюртманомасини таъминлаш кафолат хати махсус банк бланкасида урнатилган тартибда тақдим этишлари лозим. Объект бошланғич нархининг 20% миқдорида айланма маблағлар мавжудлиги ҳақидаги тижорат банки томонидан тасдиқланган маълумотнома ёки айланма маблағлар билан таъминлаш тўғрисидаги тижорат банк кафиллигини урнатилган тартибда тақдим этишлари лозим. Иштирокчи тендерда катнашиш учун талаб килинган хужжатларни юклаб олиб, тулдириб узи учун очилган кабинетига(папкасига) кайта юклаши лозим. Тендер савдоларида қатнашиш истагини билдирган қурилиш ташкилотлари раҳбарларига Ўзбекистон Республикаси Президентининг 2020 йил 21 августдаги “Маҳаллий ишлаб чиқарувчиларни қўллаб-қувватлашга доир қўшимча чора-тадбирлар тўғрисида”ги ПҚ-4812 – сонли қарори ҳамда Ўзбекистон Республикаси Вазирлар Маҳкамасининг 2021 йил 29 январдаги «Маҳаллий ишлаб чиқарувчиларни қўллаб-қувватлаш чора-тадбирлари тўғрисида»ги 41-сонли қарорига асосан:
қурилиш жараёнида харид қилиниши назарда тутилган товарлар (ишлар, хизматлар) асосан маҳаллий ишлаб чиқарувчилардан харид қилиш имконияти мажбурий тартибда ўрганилиши шарт;
Давлат харидларидаги иштироки вақтинчалик тақиқланган ва чегараланган хорижда ишлаб чиқарилган товарлар (ишлар, хизматлар) рўйхати тасдиқланган.
